import back from '../image/headbg.jpg'

function index() {

    const style = {
        backgroundImage:`url(${back})`,
        backgroundSize:"cover",
        width:"100%",
        height:"100px"
    }
    const padding={
        marginTop:"10%"
    }
    return (
        <div className="" style={style}> 
           <div className="row">
                <div className="col-6">
                    <h1 className="w3-text-purple" style={padding}>TechPort</h1>
                </div>
           </div>
        </div>
    )
}

export default index
